        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <Slider {...settings}>
                <BannerWrap><img src='http://img3.imgtn.bdimg.com/it/u=1285066072,608135153&fm=26&gp=0.jpg'/></BannerWrap>
                <BannerWrap></BannerWrap>
                <BannerWrap></BannerWrap>
                <BannerWrap></BannerWrap>
                <BannerWrap></BannerWrap>
                <BannerWrap></BannerWrap>
            </Slider>
        );
    }
}
export default LeftBanner;
